import styled from "styled-components";
import arrow from "./assets/ArrowLeft.png";

const Container = styled.div`
  width: 400px;
  margin: auto auto;
`;

const Header = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  position: fixed;
  top: 0;
`;

const Arrow = styled.img`
  width: 24px;
`;

function JoinSpace() {
  return (
    <Container>
      <Header>
        <Arrow src={arrow} alt="이전" />
        <div>가입하기</div>
      </Header>
      <div>
        <div>이메일</div>
        <div>비밀번호</div>
        <button>회원가입</button>
      </div>
    </Container>
  );
}

export default JoinSpace;
